function Cell(props) {
	return (
		<button className="Cell" onClick={props.onClick}>
			X
		</button>
	);
}

function Board() {
	return (
		<div className="row">
			<Cell />
			<Cell />
			<Cell />
		</div>
	);
}

export default function Game() {
	return <Board />;
}
